// Header.js
import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header>
      <nav>

        <ul>
          <li>
            <Link to="/">Home </Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
          <li>
            <Link to="/blog">Blog</Link>
          </li>

        </ul>

      <ul>
        <li>DELHI NCR</li>
        <li>GET APP</li>
        <li></li>
        <li></li>
      </ul>


      </nav>
    </header>
  );
}


export default Header;
